import React from "react";

import { Text, StyleSheet, View } from "react-native";

import ImageComponent from "../Components/ImageComponent";

const ImageScreen = (props) => {
  console.log("image screen");
  console.log(props);
  return (
    <View>
      <ImageComponent title="forest1" />
      <ImageComponent title="forest2" />
      <ImageComponent title="forest3" />
      <ImageComponent title="forest4" />
      <ImageComponent title="forest5" />
      <ImageComponent title="forest6" />
      <ImageComponent title="forest7" />
    </View>
  );
};

const styles = StyleSheet.create({});

export default ImageScreen;
